import ReactDOM from 'react-dom';

import './index.css';
import App from './App';
import html2canvas from "html2canvas";

setTimeout(()=>{

    html2canvas(document.querySelector("#root")).then(canvas => {
        document.body.appendChild(canvas)
    });
},1000);
ReactDOM.render(<App />, document.getElementById('root'));
